B.Tw=new A.lQ(' Reglas estrictas:\n 1.  Escribe en [NOVEL_LANGUAGE].\n 2.  La longitud del cap\xedtulo debe ser de aproximadamente 3000 caracteres.\n 3.  Mant\xe9n la coherencia con el g\xe9nero "[NOVEL_GENRE]" y las especificaciones "[NOVEL_SPECIFICATIONS]".\n 4.  Haz la historia atractiva y que el lector quiera seguir leyendo (excepto en el cap\xedtulo final).\n 5.  **Muy importante**: Comienza tu respuesta directamente con la l\xednea del t\xedtulo del cap\xedtulo. **NO** escribas nada antes de esta l\xednea.\n 6.  No uses ning\xfan formato Markdown (negrita, cursiva).\n 7.  **Formato de di\xe1logo**: Usa **siempre** comillas dobles ("") para los di\xe1logos.\n 8.  **Estilo de escritura**: La prosa debe parecerse a la de una novela publicada, no a un guion.\n \n 9.  **An\xe1lisis de Contexto (Fanfiction vs. Original)**: // --- NOUVELLE R\xc8GLE ---\n     - Antes de escribir, determina si el campo "[NOVEL_SPECIFICATIONS]" describe una **historia original** o una **fanfiction** (basada en una obra existente: libro, pel\xedcula, juego, etc.).\n     - Si es una **fanfiction**: Tu prioridad es respetar el lore, los personajes y la trama de la obra original. Utiliza tu conocimiento de esa obra. Luego, aplica las especificaciones del usuario sobre esa base.\n     - Si es una **historia original**: Basa tu creaci\xf3n *estrictamente* en las especificaciones proporcionadas.\n \n 15. **P\xe1rrafos**: Estructura el texto con p\xe1rrafos adecuados. **Siempre** usa un doble salto de l\xednea (una l\xednea vac\xeda) entre p\xe1rrafos para facilitar la lectura.\n\nPrincipio de escritura - "Mostrar, no contar": // --- NUM\xc9ROTATION MISE \xc0 JOUR ---\n10. **NO resumas los eventos**. Conc\xe9ntrate en una sola escena significativa.\n11. **Describe en detalle**: La atm\xf3sfera, las expresiones faciales, los detalles sensoriales.\n12. **Representa la vida interior**: Muestra las emociones a trav\xe9s de acciones, no las nombres directamente.\n13. **Ritmo**: No apresures la historia. T\xf3mate tiempo para la psicolog\xeda de los personajes.\n14. **Coherencia**: Aseg\xfarate de que las acciones de los personajes sean coherentes.\n',"Crea el **primer cap\xedtulo** de una nueva novela en [NOVEL_LANGUAGE] con las siguientes caracter\xedsticas:",'Escribe el **siguiente cap\xedtulo (Cap\xedtulo [NEXT_CHAPTER_NUMBER])** para la novela "[NOVEL_TITLE]".','Escribe el **cap\xedtulo final** para la novela "[NOVEL_TITLE]", llevando la historia a una conclusi\xf3n satisfactoria.',"Instrucciones adicionales para el cap\xedtulo final: Crea un final coherente. Resuelve las tramas principales. Describe la situaci\xf3n final de los personajes.","CONTEXTO:","\xdaltimo cap\xedtulo (Cap\xedtulo [CHAPTER_NUMBER]):","Contexto relevante:","Como recordatorio, la \xfaltima frase fue:","\n**Prioridad absoluta:** La historia debe ser una continuaci\xf3n directa y l\xf3gica de la \xfaltima frase.","Formato requerido:\nCap\xedtulo 1: [T\xedtulo atractivo]\n\n[Contenido del Cap\xedtulo 1 aqu\xed...]","Formato requerido:\nCap\xedtulo [NEXT_CHAPTER_NUMBER]: [T\xedtulo interesante]\n\n[Contenido del Cap\xedtulo [NEXT_CHAPTER_NUMBER] aqu\xed...]","Formato requerido:\nCap\xedtulo Final: [T\xedtulo emotivo]\n\n[Contenido del cap\xedtulo final aqu\xed...]","Cap\xedtulo 1","Cap\xedtulo Final","Cap\xedtulo ","","No hay contexto disponible.","Plan de la historia (Resumen general de la historia hasta ahora)","--- Extracto relevante [NUMBER] ---","--- Fin del extracto ---","Esquema de la trama para los pr\xf3ximos 10 cap\xedtulos (hilo conductor):","\n**Regla de prioridad**: Este esquema es tu hilo conductor. SIN EMBARGO, si entra en conflicto con la continuaci\xf3n l\xf3gica de la frase/cap\xedtulo anterior, **siempre prioriza la continuaci\xf3n l\xf3gica** (el contexto FAISS).")
